import React from "react";
import BoxStyle from "../components/Careers/CareerBox";

const Career = () => {
  const company = "Example Company";
  const position = "Software Engineer";
  const location = "New York";
  const description =
    "Lorem ipsum dolor sit amet, consectetur adipiscing elit..."; // Your job description here

  return (
    <div className="text-black font-equinox-sans bg-[#d6d4d4] bg-cover">
      <BoxStyle
        companyName={company}
        jobPosition={position}
        jobLocation={location}
        jobDescription={description}
      />
    </div>
  );
};

export default Career;
